import React, { useState, useEffect } from 'react';
import { DataTable } from 'simple-datatables';
import './Orderrecord.css'; // Import your CSS file for styling
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { useNavigate } from 'react-router-dom';

const Orderrecord = () => {
    const [orders, setOrders] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        // Fetch orders data from your API
        fetch("/getorder", {
            method: "GET",
            headers: {
                Accept: "application/json",
            },
        })
        .then((response) => response.json())
        .then((data) => {
            setOrders(data);
        })
        .catch((error) => {
            console.error("Error fetching orders:", error);
        });
    }, []);

    const handleDeleteOrder = async (orderId) => {
        try {
            // Send a DELETE request to your server to delete the order with 'orderId'
            const response = await fetch(`/deleteOrder/${orderId}`, {
                method: "DELETE",
            });

            if (response.status === 200) {
                // Order deleted successfully
                console.log("Order deleted successfully");
                toast.success("Order deleted successfully");

                // Remove the deleted order from the 'orders' state
                setOrders((prevOrders) => prevOrders.filter((order) => order._id !== orderId));
            } else {
                // Handle delete error
                console.log("Failed to delete order");
                toast.error("Failed to delete order");
            }
        } catch (error) {
            console.error("Error deleting order:", error);
            // Handle any other errors that may occur during deletion
        }
    };

    useEffect(() => {
        const datatables = document.querySelectorAll('.datatable');

        datatables.forEach((datatable) => {
            new DataTable(datatable);
        });
    }, []);

    return (
        <>
            <section className="section order-record min-vh-100 d-flex flex-column align-items-center py-4">
                <div className="container">
                    <div className="card justify-content-center">
                        <div className="card-body">
                            <h5 className="card-title col-lg-12">Order Records</h5>
                            <table className="table table-bordered datatable">
                                <thead>
                                    <tr>
                                        <th scope="col">Order ID</th>
                                        <th scope="col">User ID</th>
                                        <th scope="col">Shop ID</th>
                                        <th scope="col">Order Date</th>
                                        <th scope="col">Total Amount</th>
                                        <th scope="col">Order Status</th>
                                        <th scope="col">Payment Status</th>
                                        <th scope="col">Delete</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {orders.map((order) => (
                                        <tr key={order._id}>
                                            <td>{order._id}</td>
                                            <td>{order.userID ? order.userID : 'N/A'}</td>
                                            <td>{order.shopID ? order.shopID : 'N/A'}</td>
                                            <td>{order.orderDate ? new Date(order.orderDate).toLocaleDateString() : 'N/A'}</td>
                                            <td>{order.totalAmount ? order.totalAmount : 'N/A'}</td>
                                            <td>{order.orderStatus ? order.orderStatus : 'N/A'}</td>
                                            <td>{order.paymentStatus ? order.paymentStatus : 'N/A'}</td>
                                            <td>
                                                <button
                                                    className="btn btn-primary w-100"
                                                    type="button"
                                                    onClick={() => handleDeleteOrder(order._id)}
                                                >
                                                    Delete
                                                </button>
                                            </td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Orderrecord;
